script: |
  super -f text -I q3550.spq | sort > q3550.out

inputs:
  - name: q3550.spq
    data: |
      SELECT col2 AS col1 FROM tab0 (FORMAT parquet) WHERE NOT 44 * - CAST ( - col2 AS INTEGER ) NOT IN ( - + col2 * - col2 + + + col0 * - + col0 * + 96 );
  - name: tab0

outputs:
  - name: q3550.out
    data: |
